package com.vlearn.android.setting.myvlearn;

public class ParentTeacherCollection {

	String id;
	String first_name;
	String last_name;
	String username;
	String email;
	String avatar;
	String projectType;
	
	public ParentTeacherCollection(String id, String first_name, String last_name, String username, String email, String avatar, String projectType) {
		// TODO Auto-generated constructor stub
		this.id = id;
		this.first_name = first_name;
		this.last_name = last_name;
		this.username = username;
		this.email = email;
		this.avatar = avatar;
		this.projectType = projectType;
	}
	
}
